-- -----------------------------------------------------
-- Table grade_instruction_type
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS grade_instruction_type(
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;

LOCK TABLES grade_instruction_type WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table relationship_type
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS relationship_type(
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = INNODB;

LOCK TABLES relationship_type WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table reference_type
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS reference_type(
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`))
ENGINE = InnoDB;

LOCK TABLES reference_type WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table `document_type`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS document_type (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE INDEX `name_UNIQUE` (`name` ASC))
ENGINE = InnoDB;

LOCK TABLES document_type WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table `person_type`
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS person_type (
  `id` INT NOT NULL AUTO_INCREMENT,
  `name` VARCHAR(45) NOT NULL,
  PRIMARY KEY (`id`),
  UNIQUE INDEX `name_UNIQUE` (`name` ASC))
ENGINE = InnoDB;

LOCK TABLES person_type WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table person
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS person(
  `id` INT NOT NULL AUTO_INCREMENT,
  `first_name` VARCHAR(45) NULL,
  `father_name` VARCHAR(45) NULL,
  `mother_name` VARCHAR(45) NULL,
  `sex` TINYINT NOT NULL DEFAULT 1,
  `birth_date` DATETIME NULL,
  `person_type_id` INT NOT NULL,
  `document_type_id` INT NOT NULL,
  `document` VARCHAR(45) NOT NULL,
  `email` VARCHAR(45) NULL,
  `mobile` TEXT NULL,
  `telephone` TEXT NULL,
  `user_register` VARCHAR(500) NOT NULL DEFAULT '',
  `time_stamp` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  CONSTRAINT `person_fk0`
    FOREIGN KEY (`document_type_id`)
    REFERENCES document_type(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `person_fk1`
    FOREIGN KEY (`person_type_id`)
    REFERENCES person_type(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = INNODB;

LOCK TABLES person WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table attorney
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS attorney(
  `id` INT NOT NULL AUTO_INCREMENT,
  `person_id` INT NOT NULL,
  `grade_instruction_type_id` INT NOT NULL,
  `relationship_type_id` INT NOT NULL,
  `work_center` VARCHAR(200) NULL,
  `ocupation` VARCHAR(200) NULL,
  `user_register` VARCHAR(500) NOT NULL DEFAULT '',
  `time_stamp` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  CONSTRAINT `attorney_fk0`
    FOREIGN KEY (`grade_instruction_type_id`)
    REFERENCES grade_instruction_type(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `attorney_fk1`
    FOREIGN KEY (`relationship_type_id`)
    REFERENCES relationship_type(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `attorney_fk2`
    FOREIGN KEY (`person_id`)
    REFERENCES person(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = INNODB;

LOCK TABLES attorney WRITE;
UNLOCK TABLES;

-- -----------------------------------------------------
-- Table student
-- -----------------------------------------------------
CREATE TABLE IF NOT EXISTS student(
  `id` INT NOT NULL AUTO_INCREMENT,
  `person_id` INT NOT NULL,
  `attorney_id` INT NOT NULL,
  `person_live_id` INT NOT NULL,
  `study_certificate` TINYINT NULL,
  `brother_number` INT NULL,
  `reference_type_id` INT NOT NULL,
  `user_register` VARCHAR(500) NOT NULL DEFAULT '',
  `time_stamp` TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`),
  CONSTRAINT `student_fk0`
    FOREIGN KEY (`person_id`)
    REFERENCES person(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `student_fk1`
    FOREIGN KEY (`attorney_id`)
    REFERENCES attorney(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION,
  CONSTRAINT `student_fk3`
    FOREIGN KEY (`reference_type_id`)
    REFERENCES reference_type(`id`)
    ON DELETE NO ACTION
    ON UPDATE NO ACTION)
ENGINE = InnoDB;

LOCK TABLES student WRITE;
UNLOCK TABLES;

